import { useEffect, useState } from 'react';
import { subscribeToTimer } from './store/state/projects/client';

function App() {

  const [x, setx] = useState(null);

  useEffect(()=> {
    subscribeToTimer((e, ts)=>setx(ts))
  }, [])
  return (
    <div className="App">
     Chhavi -- {x}
    </div>
  );
}

export default App;
